// components/Tile.js
import styles from './Tile.module.css'

  const Tile = (props) => (
    <div className={styles.tileStyle}>

        <div className={styles.topHalf}>
            <img className={styles.photo} src={props.src}></img>
        </div>

      <div className={styles.bottomHalf}>
          <h1>Hello</h1><br></br>
          <p>Life is good</p>
      </div>

      {props.children}

    </div>
  );

  export default Tile;
